TITLE:
  - 'Monolithic xfsi with Nitsche including Solid Sided interface stress representation,'
  - 'ALE-Fluid, matching grid on the interface'
PROBLEM TYPE:
  PROBLEMTYPE: "Fluid_Structure_Interaction_XFEM"
ALE DYNAMIC:
  TIMESTEP: 0.0002
  LINEAR_SOLVER: 4
STRUCTURAL DYNAMIC:
  DYNAMICTYPE: "OneStepTheta"
  TIMESTEP: 0.0002
  NUMSTEP: 2
  LINEAR_SOLVER: 2
STRUCTURAL DYNAMIC/ONESTEPTHETA:
  THETA: 1
FSI DYNAMIC:
  COUPALGO: "iter_xfem_monolithic"
  MAXTIME: 0.0004
  NUMSTEP: 2
  TIMESTEP: 0.0002
FSI DYNAMIC/MONOLITHIC SOLVER:
  INFNORMSCALING: false
  ITEMAX: 5
  TOL_DIS_RES_L2: 1e-08
  TOL_DIS_RES_INF: 0.1
  TOL_DIS_INC_L2: 0.1
  TOL_DIS_INC_INF: 0.1
  TOL_PRE_RES_L2: 1e-08
  TOL_PRE_RES_INF: 0.1
  TOL_PRE_INC_L2: 0.1
  TOL_PRE_INC_INF: 0.1
  TOL_VEL_RES_L2: 1e-08
  TOL_VEL_RES_INF: 0.1
  TOL_VEL_INC_L2: 0.1
  TOL_VEL_INC_INF: 0.1
FLUID DYNAMIC:
  LINEAR_SOLVER: 3
  NONLINITER: Newton
  GRIDVEL: OST
  NUMSTEP: 2
  TIMESTEP: 0.0002
  MAXTIME: 0.0004
  THETA: 1
FLUID DYNAMIC/RESIDUAL-BASED STABILIZATION:
  STABTYPE: "edge_based"
FLUID DYNAMIC/EDGE-BASED STABILIZATION:
  EOS_PRES: "std_eos"
  EOS_CONV_STREAM: "std_eos"
  EOS_DIV: "div_jump_std_eos"
  PRES_KRYLOV_2Dz: true
  EOS_DEFINITION_TAU: "Schott_Massing_Burman_DAngelo_Zunino"
CUT GENERAL:
  KERNEL_INTERSECTION_FLOATTYPE: "cln"
  KERNEL_DISTANCE_FLOATTYPE: "cln"
  SPLIT_CUTSIDES: false
XFEM GENERAL:
  NODAL_DOFSET_STRATEGY: "ConnectGhostDofsets_PerNodeAndPosition"
  VOLUME_GAUSS_POINTS_BY: "DirectDivergence"
XFLUID DYNAMIC/GENERAL:
  XFLUID_TIMEINT: "STD=COPY_and_GHOST=COPY/GP"
  ALE_XFluid: true
  XFLUID_TIMEINT_CHECK_INTERFACETIPS: false
XFLUID DYNAMIC/STABILIZATION:
  VISC_ADJOINT_SYMMETRY: "none"
  NIT_STAB_FAC: 5
  NIT_STAB_FAC_TANG: 5
  VISC_STAB_TRACE_ESTIMATE: "eigenvalue"
  VISC_STAB_HK: "ele_vol_div_by_cut_surf"
  MASS_CONSERVATION_COMBO: "sum"
  MASS_CONSERVATION_SCALING: "full"
  GHOST_PENALTY_STAB: true
  GHOST_PENALTY_TRANSIENT_STAB: true
  GHOST_PENALTY_2nd_STAB: true
  IS_PSEUDO_2D: true
XFLUID DYNAMIC/XFPSI MONOLITHIC:
  ITEMAX_OUTER: 3
SOLVER 1:
